                {
                  "key": "4i58p",
                  "text": "A mammogram is an X-ray image of your breast used to screen for breast cancer. ",

                      "FONT:Helvetica"
                    ]
                  }
                },
                {
                  "key": "2643r",
                  "text": "During a mammogram, you stand in front of an X-ray machine designed for mammography. A technician places your breast on a platform that holds the X-ray film and positions the platform to match your height. The technician helps you position your head, arms and torso to allow an unobstructed view of your breast. ",

                {
                  "key": "8cc2t",
                  "text": "An X-ray captures black-and-white images of your breasts that are displayed on a computer screen and examined by a doctor who looks for signs of cancer. ",

                },
                {
                  "key": "c5gfq",
                  "text": "A mammogram can be used either for screening or for diagnostic purposes. Screening refers to looking for breast cancer when a woman has no symptoms. In a woman with a breast lump, a mammogram can be used to look for the cause of her symptoms.",

                {
                  "key": "4i58p",
                  "text": "Most guidelines recommend mammography screening for women in their 50s. For women younger than that, there is less certainty. Recommendations from groups like the US Preventative Services Task Force (USPSTF) and American Cancer Society (ACS) have shifted in recent years creating possible confusion. ",
                  "type": "unstyled",

                    ]
                  }
                },
                {
                  "key": "iviv",
                  "text": "Currently, for women in their 40s, the ACS recommends women ages 40 to 44 should have the choice to start annual breast cancer screening with mammograms (if they wish to do so) and women age 45 to 54 should get mammograms every year. ",
                  "type": "unstyled",
                  "depth": 0,

                      "FONT:Helvetica"
                    ]

                },

                  "key": "771pg",
                  "text": "The USPSTF recommends the decision to start regular, biennial screening mammography before the age of 50 years should be an individual one and take patient context into account, including the patient’s values regarding specific benefits and harms. ",
                  "type": "unstyled",
                  "depth": 0,
                  "inlineStyleRanges": [

                  "key": "98aan",
                  "text": "A common thread in the recommendations is that all women should be familiar with the known benefits, limitations, and potential harms linked to breast cancer screening.",
